import React, { Component } from 'react'

class PreviousExchanges extends Component {
  renderExchanges = () => this.props.exchanges.map(exchange => {
    <p key={exchange.id}>{exchange.selected_currency} = {exchange.user_currency}</p>
  })

  render() {
    return(
      <p>{renderExchanges()}</p>
    )
  }
}

export default PreviousExchanges
